import classes from "./Dialogs.module.css";
import { NavLink } from "react-router-dom";

const DialogItem = (props) => {
  return (
    <div className={classes.dialog + " " + classes.active}>
      <NavLink to={"/dialogs/" + props.id} className={({isActive}) => isActive ? classes.activeLink : classes.dialog}>{props.name}</NavLink>
    </div>
  );
};


const Dialogs = () => {
  let dialogsData = [
    { id: 1, name: "Asik" },
    { id: 2, name: "Beka" },
    { id: 3, name: "Azik" },
    { id: 4, name: "Baur" },
  ];

  let messagesData = [
    { id: 1, message: "Hello" },
    { id: 2, message: "Hi" },
    { id: 3, message: "Fuck you" },
    { id: 4, message: "Bitch" },
  ];

  let dialogElements = dialogsData.map((dialog) => {
    return <DialogItem name={dialog.name} id={dialog.id} />;
  });

  let messageElements = messagesData.map((msg) => {
    return <Message message={msg.message} />;
  });

  return (
    <div className={classes.dialogs}>
      <div className={classes.dialogsItems}>{dialogElements}</div>
      <div className={classes.messages}>{messageElements}</div>
    </div>
  );
};

export default Dialogs;
